import React,{useState, useEffect} from 'react'
import MenuItems from './MenuItems.js'
import './Navbar.css'

const Navbar = () => {
    const [clicked, setClicked] = useState(false);
    useEffect(()=>{
        if(window.innerWidth >= 1250){
            setClicked(false);
        }
    });

    return(
        <div className="Navbar">
            <label className="navbar-title">THE FALSE 9</label>
            <nav>
                <div className="navigation">
                <ul className={clicked?"nav-links-list nav-links-list-active":"nav-links-list nav-links-list-inactive"}>
                    {MenuItems.map((item, index) => {return <li key={index} className={index%2===0?"list-item list-item-even":"list-item list-item-odd"}><a className={item.className} href={item.url}>{item.title.toUpperCase()}</a></li>;})}
                </ul>
                <ul className="social-links">
                    <li><i className={clicked?"fas fa-times":"fas fa-bars"} onClick={() => setClicked(!clicked)}/></li>
                    <li><a href=""><i className="fab fa-facebook-f"/></a></li>
                    <li><a href=""><i className="fab fa-twitter"/></a></li>
                    <li><a href=""><i className="fab fa-youtube"/></a></li>
                </ul>
                </div>
            </nav>
        </div>
    );
};

export default Navbar;
